import React, { useState, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { AuthContext } from '../../context/AuthContext';
import CartIcon from '../cart/CartIcon';
import categories from '../../config/categories';

const Navbar = () => {
  const navigate = useNavigate();
  const context = useContext(AuthContext);
  const { currentUser, token, logout } = context || { currentUser: null, token: null, logout: () => {} };
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isProfileMenuOpen, setIsProfileMenuOpen] = useState(false);
  const [mobileProductsOpen, setMobileProductsOpen] = useState(false);

  // Determine if user is authenticated based on token
  const isAuthenticated = !!token;

  // Get dashboard link based on user role
  const getDashboardLink = () => {
    if (!currentUser) return '/login';

    switch (currentUser?.role) {
      case 'admin':
        return '/admin';
      case 'seller':
        return '/seller';
      case 'customer':
        return '/customer';
      default:
        return '/dashboard';
    }
  };

  // Handle logout and redirect to home page
  const handleLogout = () => {
    logout();
    setIsProfileMenuOpen(false);
    setIsMenuOpen(false);
    // Redirect to home page
    window.location.href = '/';
  };

  return (
    <>
      <nav className="bg-white text-gray-800 border-b shadow-sm">
        <div className="container mx-auto px-4">
          <div className="flex justify-between items-center py-3">
            <Link to="/" className="text-xl font-bold flex items-center space-x-2">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-8 w-8 text-green-700" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M10 3.5a6.5 6.5 0 100 13 6.5 6.5 0 000-13zM2.5 10a7.5 7.5 0 1115 0 7.5 7.5 0 01-15 0z" clipRule="evenodd" />
                <path d="M10 6a.75.75 0 01.75.75v3.5a.75.75 0 01-1.5 0v-3.5A.75.75 0 0110 6z" />
                <path d="M10 14a1 1 0 100-2 1 1 0 000 2z" />
              </svg>
              <span className="text-green-800">Ayurvedic Products</span>
            </Link>

            {/* Search Bar */}
            <div className="hidden md:flex flex-1 mx-6 relative">
              <input
                type="text"
                placeholder="Search for products..."
                className="w-full rounded-full px-4 py-2 border border-gray-300 focus:outline-none focus:ring-1 focus:ring-green-500"
              />
              <button className="absolute right-0 top-0 h-full bg-green-600 text-white rounded-r-full px-6 hover:bg-green-700 transition">
                <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
                </svg>
              </button>
            </div>

            {/* Mobile Menu Button */}
            <div className="md:hidden">
              <button
                onClick={() => setIsMenuOpen(!isMenuOpen)}
                className="text-gray-800 focus:outline-none"
              >
                <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                </svg>
              </button>
            </div>

            {/* Desktop Navigation */}
            <div className="hidden md:flex space-x-6 items-center">
              <Link to="/" className="hover:text-green-600 transition">Home</Link>

              {/* Products Dropdown */}
              <div className="relative group">
                <Link to="/products" className="hover:text-green-600 transition flex items-center">
                  Products
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 ml-1" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
                  </svg>
                </Link>
                <div className="absolute left-0 mt-2 w-64 bg-white rounded-md shadow-xl z-10 hidden group-hover:block">
                  <Link 
                    to="/products" 
                    className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 font-medium"
                  >
                    All Products
                  </Link>
                  <div className="border-t border-gray-100"></div>
                  {categories.map((category, index) => (
                    <Link 
                      key={index}
                      to={`/products?category=${encodeURIComponent(category)}`}
                      className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    >
                      {category}
                    </Link>
                  ))}
                </div>
              </div>

              {isAuthenticated ? (
                <>
                  {/* Admin Links */}
                  {currentUser?.role === 'admin' && (
                    <>
                      <Link to="/admin/users" className="hover:text-green-600 transition">Users</Link>
                      <Link to="/admin/products" className="hover:text-green-600 transition">Products</Link>
                      <Link to="/admin/orders" className="hover:text-green-600 transition">Orders</Link>
                    </>
                  )}

                  {/* Seller Links */}
                  {currentUser?.role === 'seller' && (
                    <>
                      <Link to="/seller/products" className="hover:text-green-600 transition">My Products</Link>
                      <Link to="/seller/orders" className="hover:text-green-600 transition">Orders</Link>
                    </>
                  )}

                  {/* Customer Links */}
                  {currentUser?.role === 'customer' && (
                    <>
                      <Link to="/customer/orders" className="hover:text-green-600 transition">My Orders</Link>
                    </>
                  )}

                  {/* Profile Dropdown */}
                  <div className="relative ml-3">
                    <button
                      onClick={() => setIsProfileMenuOpen(!isProfileMenuOpen)}
                      className="flex items-center hover:text-green-600 transition bg-gray-100 px-3 py-1 rounded-full"
                    >
                      <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-gray-600 mr-1" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" />
                      </svg>
                      <span className="mr-1 text-gray-800">{currentUser?.name || 'User'}</span>
                      <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 text-gray-600" viewBox="0 0 20 20" fill="currentColor">
                        <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
                      </svg>
                    </button>

                    {isProfileMenuOpen && (
                      <div className="absolute right-0 mt-2 py-2 w-48 bg-white rounded-md shadow-xl z-10">
                        <div className="px-4 py-2 border-b border-gray-100">
                          <p className="text-sm font-medium text-gray-800">Logged in as:</p>
                          <p className="text-xs text-gray-500">{currentUser?.email}</p>
                        </div>
                        <Link 
                          to={getDashboardLink()} 
                          className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                          onClick={() => setIsProfileMenuOpen(false)}
                        >
                          Dashboard
                        </Link>
                        <Link 
                          to={currentUser?.role ? `/${currentUser.role}/profile` : '/profile'} 
                          className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                          onClick={() => setIsProfileMenuOpen(false)}
                        >
                          Profile
                        </Link>
                        <button 
                          onClick={handleLogout}
                          className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                        >
                          Logout
                        </button>
                      </div>
                    )}
                  </div>

                  {/* Cart Icon (only for customers) */}
                  {(currentUser?.role === 'customer' || !currentUser?.role) && (
                    <div className="ml-4">
                      <CartIcon />
                    </div>
                  )}
                </>
              ) : (
                <>
                  <div className="flex items-center space-x-4">
                    <Link to="/login" className="hover:text-green-600 transition flex items-center text-green-700">
                      <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 mr-1" viewBox="0 0 20 20" fill="currentColor">
                        <path fillRule="evenodd" d="M3 3a1 1 0 011-1h12a1 1 0 011 1v3a1 1 0 01-.293.707L12 11.414V15a1 1 0 01-.293.707l-2 2A1 1 0 018 17v-5.586L3.293 6.707A1 1 0 013 6V3z" clipRule="evenodd" />
                      </svg>
                      Login
                    </Link>
                    <Link to="/register" className="bg-green-600 hover:bg-green-700 text-white px-4 py-2 rounded-full transition">
                      Register
                    </Link>
                    <div className="ml-4">
                      <CartIcon />
                    </div>
                  </div>
                </>
              )}
            </div>
          </div>
        </div>

        {/* Categories Navigation */}
        <div className="hidden md:block border-t border-gray-200">
          <div className="container mx-auto px-4">
            <div className="flex items-center py-2 space-x-6 text-sm">
              <div className="relative group">
                <button className="flex items-center space-x-1 font-medium text-gray-700 hover:text-green-600 py-2">
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                  </svg>
                  <span>All Categories</span>
                </button>
                <div className="absolute left-0 mt-2 w-64 bg-white rounded-md shadow-xl z-10 hidden group-hover:block">
                  {categories.map((category, index) => (
                    <Link 
                      key={index}
                      to={`/products?category=${encodeURIComponent(category)}`}
                      className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    >
                      {category}
                    </Link>
                  ))}
                </div>
              </div>
              <Link to="/" className="text-gray-700 hover:text-green-600">Home</Link>
              <Link to="/products" className="text-gray-700 hover:text-green-600">All Products</Link>
              <Link to="/products?category=herbs" className="text-gray-700 hover:text-green-600">Herbs</Link>
              <Link to="/products?category=oils" className="text-gray-700 hover:text-green-600">Oils</Link>
              <Link to="/products?category=supplements" className="text-gray-700 hover:text-green-600">Supplements</Link>
              <Link to="/products?category=skincare" className="text-gray-700 hover:text-green-600">Skin Care</Link>
              <Link to="/products?top=true" className="text-gray-700 hover:text-green-600">Top Rated</Link>
              <Link to="/products?deal=true" className="text-green-600 font-medium">Special Deals</Link>
            </div>
          </div>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="md:hidden">
            <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3">
              <Link 
                to="/" 
                className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                onClick={() => setIsMenuOpen(false)}
              >
                Home
              </Link>
              <button 
                className="w-full text-left px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50 flex justify-between items-center"
                onClick={() => setMobileProductsOpen(!mobileProductsOpen)}
              >
                <span>Products</span>
                <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4" viewBox="0 0 20 20" fill="currentColor">
                  <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
                </svg>
              </button>
              {mobileProductsOpen && (
                <div className="pl-4">
                  <Link 
                    to="/products" 
                    className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                    onClick={() => setIsMenuOpen(false)}
                  >
                    All Products
                  </Link>
                  {categories.map((category, index) => (
                    <Link 
                      key={index}
                      to={`/products?category=${encodeURIComponent(category)}`}
                      className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                      onClick={() => setIsMenuOpen(false)}
                    >
                      {category}
                    </Link>
                  ))}
                </div>
              )}
              {isAuthenticated ? (
                <>
                  {currentUser?.role === 'admin' && (
                    <>
                      <Link 
                        to="/admin/users" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        Users
                      </Link>
                      <Link 
                        to="/admin/products" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        Products
                      </Link>
                      <Link 
                        to="/admin/orders" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        Orders
                      </Link>
                    </>
                  )}
                  {currentUser?.role === 'seller' && (
                    <>
                      <Link 
                        to="/seller/products" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        My Products
                      </Link>
                      <Link 
                        to="/seller/orders" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        Orders
                      </Link>
                    </>
                  )}
                  {currentUser?.role === 'customer' && (
                    <>
                      <Link 
                        to="/customer/orders" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        My Orders
                      </Link>
                      <Link 
                        to="/cart" 
                        className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                        onClick={() => setIsMenuOpen(false)}
                      >
                        Cart
                      </Link>
                    </>
                  )}
                  <Link 
                    to={getDashboardLink()} 
                    className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                    onClick={() => setIsMenuOpen(false)}
                  >
                    Dashboard
                  </Link>
                  <Link 
                    to={currentUser?.role ? `/${currentUser.role}/profile` : '/profile'} 
                    className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                    onClick={() => setIsMenuOpen(false)}
                  >
                    Profile
                  </Link>
                  <button 
                    onClick={handleLogout}
                    className="w-full text-left px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                  >
                    Logout
                  </button>
                </>
              ) : (
                <>
                  <Link 
                    to="/login" 
                    className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                    onClick={() => setIsMenuOpen(false)}
                  >
                    Login
                  </Link>
                  <Link 
                    to="/register" 
                    className="block px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:bg-gray-50"
                    onClick={() => setIsMenuOpen(false)}
                  >
                    Register
                  </Link>
                </>
              )}
            </div>
          </div>
        )}
      </nav>
    </>
  );
};

export default Navbar;
